B.aax=new A.ap(B.ex,["Peste Porcine Africaine (PPA)","Aretina virus mahery vaika indrindra. Tsy misy fanafody na vaksiny. Mahafaty 100% ny kisoa.","\u2022 Fanaviana mafy (41-42\xb0C)\n\u2022 Mena ny hoditra (Oreilles, Ventre)\n\u2022 Mivalana r\xe0\n\u2022 Mandeha sarotra, kivy be\n\u2022 Maty tampoka","TSY MISY FANAFODY. Vonoy sy doroy ny kisoa marary rehetra.","Tsy misy.","\u2022 Ilazao avy hatrany ny V\xe9t\xe9rinaire\n\u2022 Atokana ny trano\n\u2022 Dorana ny faty (tsy alevina)\n\u2022 Fanadiovana tanteraka","\u2022 Biosecurity hentitra\n\u2022 Tsy omena sisan-tsakafo tsy nandrahoina\n\u2022 Fefy manodidina ny trano\n\u2022 Tsy ampidirina kisoa vaovao tsy quarantaine"],t.w)
